import React from 'react';

const Home = () => {

    return (
        <>
            <div>
                <div className={'w-72 h-screen custom-shadow-home'}>Sidebar</div>
                <div className='p-7 text-2xl font-semibold '>
                    <h1>Home Page</h1>
                </div>
            </div>
        </>
    );
};

export default Home;
